import React from 'react';
import axios from 'axios';

class ItemList extends React.Component
{
    state = {
        items: []
    }

    componentDidMount() {
        axios.get('http:localhost:81/items')
            .then(res => {
                const items = res.data;
                this.setState({items});
            })
    }
    render(){
        return 'rendered item list';
    }
}

export default ItemList;
